// fetch("https://api.tradingeconomics.com/country/united-states/?client=guest:guest").then(response=>{
//     console.log(response)
// })
const EURUSDrate = () => {
    const ws = new WebSocket("ws://stream.tradingeconomics.com/?client=guest:guest", ["price", "dt"])
    ws.onmessage =(e) => {
        console.log(e)
    }
    ws.onopen = () => {
        console.log(ws.readyState)
        ws.send("{\"topic\": \"subscribe\", \"to\": \"calendar\" }")
        ws.send("{\"topic\": \"subscribe\", \"to\": \"EURUSD:CUR\" }")
    }
    


  return <div>hola</div>;
};

export default EURUSDrate;
